const Users=(props)=>{
    console.log('Users',props)
    return(
        <div>
    <ul className="list-group ">
        {
        props.users.map((user,index)=>(
                <div key={index}>
                    <li className="list-group-item list-group-item-action">
                        <h5>{user.first_name} {user.last_name}</h5>
                        <p>Email: {user.email}</p>
                    </li>
            
                </div>
           
        ))
        }
    </ul>
    </div>
    );

}

export default Users
